import { Header } from "./components/Header";
import { Resumo } from "./components/Resumo";
import { Routes } from "./routes/routes";

import { CartProvider } from "./providers/cart";

import GlobalStyle from "./styles/global";

function App() {
  return (
    <>
      <CartProvider>
        <GlobalStyle />
        <Header />
        <Resumo />
        <Routes />
      </CartProvider>
    </>
  );
}

export default App;
